"   </a>",
"   )",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F10285966\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Saflutan  (GB);",
"     </li>",
"     <li>",
"      Taflotan (DK, FI, NO, SE)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"list_set htclist drugH1Div drugBrandNames\" id=\"F10285967\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      <span class=\"list-set-name\">",
"       Ophthalmic Agent, Antiglaucoma",
"      </span>",
"     </li>",
"     <li>",
"      <span class=\"list-set-name\">",
"       Prostaglandin, Ophthalmic",
"      </span>",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block iuse drugH1Div\" id=\"F10285968\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Reported Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Decrease of intraocular pressure (IOP) in patients with open-angle glaucoma or ocular hypertension; used as monotherapy in patients intolerant/unresponsive to first-line therapy or adjunctively with beta-blocker therapy",
"    </p>",
"   </div>",
"   <div class=\"block idos drugH1Div\" id=\"F10285970\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Range",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Adults: Ophthalmic: instill 1 drop into affected eye(s) once daily in the evening",
"    </p>",
"   </div>",
"   <div class=\"block prod-avail drugH1Div\" id=\"F11821251\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Product Availability",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Product available in various countries.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F10285971\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Solution, ophthalmic [drops; preservative free]: Saflutan: 15 mcg/mL (0.3 mL) [available in packages of 30 or 90]",
"    </p>",
"   </div>",
