var title_f42_28_43461="Armpit stretch PI";
var content_f42_28_43461=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F51493%7EPI%2F78109%7EPI%2F77955&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F51493%7EPI%2F78109%7EPI%2F77955&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Armpit stretch",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 305px; height: 335px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Use your good arm to lift the affected arm onto a shelf, dresser, or other object that is chest high. Gently bend at the knees, so that your armpit stretches open. Try to push the arm up a little bit farther with each stretch. Repeat this stretch 10 to 20 times.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Bruce C Anderson, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Walk-up-wall stretch",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 264px; height: 385px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Face a wall and stand about three-quarters of an arm's length away. Put your fingers on the wall. Then walk your fingers up the wall until your arm is at shoulder level. Use your shoulder muscles as little as possible and keep your shoulders level (do not shrug them). Repeat this stretch 10 to 20 times.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Bruce C Anderson, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Towel stretch",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 311px; height: 323px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Hold a 3-foot-long towel in both hands behind your back in the horizontal position. Then use your good arm to pull the towel so that your affected arm moves toward your lower back. You can also hold the towel at an angle (as shown) to do this exercise. Repeat this stretch 10 to 20 times.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Bruce C Anderson, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
