" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Measurement of prognostic factors in breast cancer",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?42/28/43465/contributors\">",
"     Author",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?42/28/43465/contributors\">",
"     Daniel F Hayes, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?42/28/43465/contributors\">",
"     Section Editor",
"    </a>",
