"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?42/28/43465/abstract/1\">",
"      Page DL. Prognosis and breast cancer. Recognition of lethal and favorable prognostic types. Am J Surg Pathol 1991; 15:334.",
"     </a>",
"    </li>",
