var title_f42_28_43467="Research criteria for intermittent explosive disorder";
var content_f42_28_43467=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PSYCH%2F65924&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PSYCH%2F65924&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Research criteria for intermittent explosive disorder",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"sublist_other_start\">",
"        <strong>",
"         A",
"        </strong>",
"        . Recurrent incidents of aggression manifest as either:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        <strong>",
"         A1",
"        </strong>",
"        . Verbal or physical aggression toward other people, animals, or property occurring twice weekly on average for one month",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent3\">",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        <strong>",
"         A2",
"        </strong>",
"        . Three episodes involving physical assault against other people or destruction of property over a one year period",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         B",
"        </strong>",
"        . The degree of aggressiveness expressed is grossly out of proportion to the provocation or any precipitating psychosocial stressors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         C",
"        </strong>",
"        . The aggressive behavior is generally not premeditated (eg, is impulsive)",
"        <strong>",
"         and",
"        </strong>",
"        is not committed in order to achieve some tangible objective (eg, money, power, or intimidation)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         D",
"        </strong>",
"        . The aggressive behavior causes either marked distress in the individual or impairment in occupational or interpersonal functioning",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         E",
"        </strong>",
"        . The aggressive behavior is not better accounted for by another mental disorder (eg, major depressive, manic, or psychotic episode; or attention-deficit/hyperactivity disorder); general medical condition (eg, head trauma or&nbsp;Alzheimer's disease); or to the direct physiological effects of a substance",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Coccaro EF. Intermittent explosive disorder: development of integrated research criteria for Diagnostic and Statistical Manual of Mental Disorders, Fifth Edition. Compr Psychiatry 2011; 52:119. Table used with the permission of Elsevier Inc. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
