" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Jaw thrust maneuver",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 406px; height: 168px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The rescuer uses two or three fingers of each hand to lift the jaw upward and outward so that the lower central incisors are anterior to the upper central incisors. In children with traumatic injuries, the cervical spine must be maintained in a neutral position during this maneuver.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
