" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 500px\">",
"   <div class=\"ttl\">",
"    Scaphoid shift test: Step 3",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 480px; height: 361px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Begin the test by placing the patient's hand in full ulnar deviation. Using your other thumb, keep firm pressure on the scaphoid tubercle.",
